import React from 'react';
import {Button} from 'react-bootstrap';
import './itemCount.css'

const countValue = 0;

const ItemCount = () => {
  return <div className="container item-count">
            <div className="row">
                <div className="col-3">
                    <Button>-</Button>
                </div>
                <div className="col-6">
                    <input type="number" readOnly min={0} max={15} name="cantItems" value={countValue} />
                </div>
                <div className="col-3">
                    <Button>+</Button>
                </div>
            </div>
        </div>
}

export default ItemCount;
